const NavBar = () => {
  return (
    <div className={style.mainContainer}>
      <Logo className={style.logo} /> {/* Asigna la clase .logo al logo */}
      <a href="#home">HOME</a>
      <a href="#about">ABOUT ME</a>
      <a href="#portfolio">PORTFOLIO</a>
      <a href="#contact">CONTACT</a>
      <SocialLinks className={style.socialLinks} /> {/* Asigna la clase .socialLinks a SocialLinks */}
    </div>
  );
};
